import React from 'react';
import logo from './logo.svg';
import './App.css';

const list = [
    {
        "id": 1,
        "title": "Hello Wold",
        "body": "Hello Every Body"
    },
    {
        "id": 2,
        "title": "Second",
        "body": "Hello Acs"
    }
]
class App extends Component {
    constructor(props) {
        super(props);
        this.state = { list };
    }
    render(){
        return(
            <div>
                {this.state.list.map(item => (
                    <div key={item.id}>
                        <h1>{item.title}</h1>
                        <p>{item.body}</p>
                </div>
                ))}
            </div>
            );
    }
}
export default App;
